  button: {
    width: "100%",
    backgroundColor: "#007bff",
    color: "white",
    padding: "10px",
    border: "none",
    borderRadius: "7px",
    fontSize: "1rem",
    cursor: "pointer",
    marginTop: "8px",
  },
  forgotLink: {
    color: "#007bff",
    textDecoration: "underline",
    fontSize: "1rem",
    cursor: "pointer",
  },
  signupText: {
    textAlign: "center",
    marginTop: "20px",
